  \"Multilayer Polymeric Shielding to Protect Humans from Galactic Cosmic Radiation
  Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 5,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-05-06T21:14:57.555501\",\n\t\"name\":
  \"multilayer-polymeric-shielding-to-protect-humans-from-galactic-cosmic-radiation-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"In Sub-topic X4.01, NASA has identified
  a need for advanced radiation-shielding materials and structures to protect humans
  from the hazards of galactic cosmic radiation (GCR) on long-duration lunar missions.
  The radiation species of greatest interest are light ions (particularly protons),
  heavy ions (such as iron-56) and neutrons. International Scientific Technologies,
  Inc., in conjunction with the College of William and Mary, proposes the development
  of lightweight, multi-layered, polymeric shielding against GCR. Phase I Technical
  Objectives include selection, design and fabrication of materials tailored to shield
  against hazardous radiation, and measurement and test of individual and layered
  materials using available radiation sources.  The anticipated result of the Phase
  I and Phase II programs is the development of multi-layered shields with an outer
  layer of hydrogenous polymeric material for significant dose reduction of incident
  GCR ions and inner layers of polymeric composites containing additives chosen to
  moderate and absorb neutrons resulting from fragmentation of incoming heavy ions
  and to absorb short wavelength electromagnetic radiation resulting from the slowing
  of the GCR particles and capture of neutrons.  The Technology Readiness Level (TRL)
  at the beginning of Phase I is 3. At the end of Phase I, the TRL will be 4 or higher.\",\n\t\"license_title\":
